import React from 'react';
import classes from './Main.module.css';

function Main() {
  return (
      <div className={classes.main}>
          <div className={classes.container}>
              <div className={classes.mySelf}>Hello</div>
              <div className={classes.photo}>
                  <img src="https://townsquare.media/site/366/files/2019/03/GettyImages-88574703.jpg?w=980&q=75"/>
              </div>
          </div>
      </div>
  );
}

export default Main;
